import './App.css';
import CalculatorTab from './Calculator/CalculatorTab';
import 'antd/dist/antd.css';

function App() {
  return (
    <div className="App">
      <div className='calc-wrapper'>
        <div className='row'>
          <button>7</button>
          <button>8</button>
          <button>9</button>
          <button>/</button>
        </div>
      </div>
    </div>
  );
}

export default App;
